    const[pageIndex,setPageIndex]=useState(1);
    const swr=useSWR(`http://localhost:4005/videos/3`)
    console.log(swr.data)

    return <div>
  {swr &&  swr.data.map((item)=>(<p>{item.title}</p>))}
  
  </div>
    
  


}

export default Pagination
